	this.requestTRitsn1056v = function(ac_no) {

		nexAjax.send({
			url : '/tr/W61OI67.json',
			param : {
				SysAcntNo : ac_no,
				CrdtSect : '1',
				AskCnt : '100',
				SaveKey1 : '',
				SaveKey2 : ''
			},

			secure : true,

			dataType : 'json',

			callback : function(data) {

				if (typeof data.W61OI67_GRIDOutStr_OUT_REC != "undefined" && data.W61OI67_GRIDOutStr_OUT_REC.length != 0) {
					var lastRowNum = 0;
					var isEmpty = true;
					var grid_data = data.W61OI67_GRIDOutStr_OUT_REC;

					for ( var i = 0; i < grid_data.length; i++) {
						grid_data[i].o_seq_no1 = "";
						for ( var j = 0; j < self.CodeList.length; j++) {
							if (grid_data[i].o_ItemCd == '') {
								grid_data[i].o_item_nm = '';
								break;
							} else if (self.CodeList[j].code.indexOf(grid_data[i].o_ItemCd.replace("A","")) > -1) {
								grid_data[i].o_item_nm = self.CodeList[j].name;
								break;
							}
						}
					}

					var colls = [ 'o_seq_no1', 'o_ItemCd','o_item_nm' ];
					var data_value = nexMdi.dataMapper(grid_data, colls);

					self.GridObj.pqGrid({
						dataModel : {
							data : data_value,
							sorting : 'local',
							sortIndx : 2,
							sortDir : "up"
						}
					});
					self.GridObj
							.pqGrid("refreshDataAndView");
				} else {
					self.GridObj.pqGrid({
						dataModel : {
							data : [],
							sorting : 'local',
							sortIndx : 2,
							sortDir : "up",
							noDataMsg : true
						}
					});
					self.GridObj.pqGrid("setSelection", {rowIndx : 0});
					self.GridObj.pqGrid("refreshDataAndView");
				}
				self.SearchCheck = false;
			}

		});

	};

