	this.realData_A = function(data) {
		console.log("REAL DATA A JS CALL");
		for(var idx in data.value){
			$("#"+idx).html(data.value[idx]);
		}


		if (typeof self.ChartObj != "undefined" && self.ChartObj != null && self.ChartObj != '') {
			//var siga = data.value['029'].substring(0, 1) == "-" ? data.value['029'].substring(1) : data.value['029'];
			var siga	=	$("#open").val();
			siga	=	siga.split(",").join("");
			//console.log("SIGA=>" + siga);
			
			var goga = data.value['030'].substring(0, 1) == "-" || data.value['030'].substring(0, 1) == "+" ? data.value['030'].substring(1) : data.value['030'];
			var jega = data.value['031'].substring(0, 1) == "-" || data.value['031'].substring(0, 1) == "+" ? data.value['031'].substring(1) : data.value['031'];
			var joga = data.value['023'].substring(0, 1) == "-" || data.value['023'].substring(0, 1) == "+" ? data.value['023'].substring(1) : data.value['023'];
			var cheg = data.value['032'].substring(0, 1) == "-" || data.value['032'].substring(0, 1) == "+" ? data.value['032'].substring(1) : data.value['032'];
			

			goga	=	goga.substring(1);
			jega	=	jega.substring(1);
			joga	=	joga.substring(1);
			
			console.log("==>  1222<==");
			console.log(data);
			console.log("GOGA : " + goga + ", JEGA : " + jega + ", JOGA : " + joga + ", CHEG : " + cheg);
			
			var date = new Date();
			var recpDate = Date.UTC(date.getFullYear(), date.getMonth(), date.getDate());
			var recpTime = data.value['034'];

			var dateHours = recpTime.substring(0, 2) || '00';
			var dateMinutes = recpTime.substring(2, 4) || '00';
			var dateSeconds = recpTime.substring(4, 6) || '00';

			var dateUtcTime;
			var dateLastTime;
			var updateTime;
			var lastTime;

			// self.CurrDate =
			// nexUtils.date2Utc(Highcharts.dateFormat('%Y%m%d',
			// dateLastTime) + recpTime);

			// var redraw = true;
			var resData = [];
			var dataIndex;

			// nexChart DataIndex 2: , 3: , 4: , 1: , 7: 
			switch (Number(self.DataIndex)) {
			case 1:
				dataIndex = 2;
				break; // 
			case 2:
				dataIndex = 3;
				break; // 
			case 3:
				dataIndex = 4;
				break; // 
			case 4:
				dataIndex = 5;
				break; // 
			case 5:
				dataIndex = 1;
				break; // 
			}

			if (self.DataIndex == '1' || self.DataIndex == '2') {
				if (self.DataIndex == '3')
					dateUtcTime = Date.UTC(date.getFullYear(), date.getMonth());
				else if (self.DataIndex == '4')
					dateUtcTime = Date.UTC(date.getFullYear());
				else
					dateUtcTime = Date.UTC(date.getFullYear(), date.getMonth(), date.getDate());
				dateLastTime = self.ChartObj.getLastDataTimeUtc();
				updateTime = Highcharts.dateFormat('%Y%m%d%H%M',dateUtcTime);
				lastTime = Highcharts.dateFormat('%Y%m%d%H%M',dateLastTime);

				resData = [ Number(dateUtcTime), Number(siga),
						Number(goga), Number(jega), Number(joga),
						Number(cheg), Number(dataIndex), null,
						Number(lastTime) ];
			} else {
				dateUtcTime = nexUtils.date2Utc(Highcharts.dateFormat('%Y%m%d', recpDate)+ '' + dateHours + '' + dateMinutes);
				dateLastTime = self.ChartObj.getLastDataTimeUtc();
				updateTime = Highcharts.dateFormat('%Y%m%d%H%M',dateUtcTime);
				lastTime = Highcharts.dateFormat('%Y%m%d%H%M',dateLastTime);

				if (dateLastTime < dateUtcTime) { //       						
					/*
					 * if(dateHours == '15') { //   
					 * updateTime =
					 * nexUtils.addDateFullTime(updateTime,'mi',Number(self.Gap));
					 * dateUtcTime = nexUtils.date2Utc(updateTime);
					 * redraw = false; // chart ADD redraw   }
					 * else
					 */if (dateUtcTime - dateLastTime - (self.Gap * 60000) == 0) { // --*60000(ms);  
						updateTime = nexUtils.addDateFullTime(updateTime, 'mi', Number(self.Gap));
						dateUtcTime = nexUtils.date2Utc(updateTime);
						// redraw = false; // chart ADD redraw 
						// 
					} else {
						dateUtcTime = nexUtils.date2Utc(lastTime);
					}
				} else {
					dateUtcTime = nexUtils.date2Utc(lastTime);
				}

				resData = [ Number(dateUtcTime), Number(joga),
						Number(joga), Number(joga), Number(joga),
						Number(cheg), Number(dataIndex),
						Number(self.Gap), Number(lastTime) ];
			}

			self.ChartObj.setRealTimeData(resData, false);

		}

		//   
		//     3000ms 
		if (self.Timer.time() > 3000) {
			if (typeof self.ChartObj != "undefined" && self.ChartObj != null && self.ChartObj != '') {
				self.ChartObj.redraw();
			}

			self.Timer.start();
		}

	};
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
	
