	this.drawSetTab = function(series_id) {
		var series_datas = self.ChartValue[series_id];

		$("#mdi" + self.ViewName).find("#ul_values").html('');
		var html = [];
		for ( var i = 0; i < series_datas.length; i++) {
			var name = series_datas[i].name;
			var value = series_datas[i].value;
			html.push("<li>");
			html.push("<span>" + name + "</span>");
			html.push("<div class='num_updown'>");
			name = name.replaceAll('%', '');
			name = name.replaceAll('&', '');
			name = name.replaceAll(' ', '');
			name = name.replaceAll(',', '');
			html.push("<input class='text' type='text' value='"+ value + "' title='" + name+ "' maxlength='3'>");
			html.push("<div class='btn'>");
			html.push("<input id='btn_"+ series_id+ "_up' name='btn_up' type='button' title=''>");
			html.push("<input id='btn_"+ series_id+ "_down' name='btn_down' type='button' title=''>");
			html.push("</div>");
			html.push("</div>");
			html.push("</li>");
		}
		html = html.join('');
		$("#mdi" + self.ViewName).find("#ul_values").html(html);

		$("#mdi" + self.ViewName).find("#ul_colors").html('');
		if (series_id == "sma") {
			var html2 = [];
			for ( var i = 0; i < series_datas.length; i++) {
				var name = series_datas[i].name;
				var value = series_datas[i].value;
				var color = series_datas[i].lineColor;
				var width = series_datas[i].lineWidth;
				html2.push("<li>");
				html2.push("<span id='sma_color'>" + name+ "<input type='button' name='sma_color_"+ i + "' style='background:" + color+ "'></span>");
				html2.push("<div class='num_updown'>");
				html2.push("<span>thickness</span>");
				html2.push("<input class='text' type='text' value='"+ width+ "' title='"+ name+ "' maxlength='3'>");
				html2.push("<div class='btn'>");
				html2.push("<input id='btn_"+ series_id+ "_up' name='btn_up' type='button' title='up'>");
				html2.push("<input id='btn_"+ series_id+ "_down' name='btn_down' type='button' title='down'>");
				html2.push("</div>");
				html2.push("</div>");
				html2.push("</li>");
			}
			html2 = html2.join('');
			$("#mdi" + self.ViewName).find("#ul_colors").html(html2);

			$("#mdi" + self.ViewName).find("#ul_colors #sma_color input[type=button]").click(function() {
				var option = {
					viewName : '05600',
					parentName : self.ViewName,
					value : {
						indx : this.name.split("_")[2]
					},
					position : 'element-bottom',
					positionTagName : this.name
				};
				nexDialog.open(option);
			});
		}

		// > INPUT BOX
		$("#mdi" + self.ViewName).find("#ul_values .num_updown input[type='text']").blur(function() {
			var val = $(this).val();
			var series_id = $(this).siblings().find("input[type='button']")[0].id.split('_')[1];
			val = Number(val);

			if (series_id == "sma" || series_id == "dis") {
				if (val >= 300)
					val = 300;
			} else if (series_id == "parabolic") {
				if (val >= 100.00)
					val = 100.00;
			} else {
				if (val >= 100.00)
					val = 100;
			}

			if (val <= 1) {
				if (series_id == "parabolic")
					val = 0.2;
				else
					val = 1;
			}

			$(this).val(val);
		}).keyup(function(event) {
			var key = event.keyCode;
			var val = Number($(this).val());

			if (series_id == "parabolic") {
				if (key == 38)
					$(this).val((val + 0.2).toFixed(2));
				else if (key == 40)
					$(this).val((val - 0.2).toFixed(2));
			} else {
				if (key == 38)
					$(this).val(val + 1);
				else if (key == 40)
					$(this).val(val - 1);
			}
		}).numbericOnly();

		// > INPUT BOX
		$("#mdi" + self.ViewName).find("#ul_colors .num_updown input[type='text']").blur(function() {
			var val = $(this).val();
			var series_id = $(this).siblings().find("input[type='button']")[0].id.split('_')[1];
			val = Number(val);

			if (val >= 5)
				val = "5.0";
			if (val <= 0.2)
				val = 0.2;

			$(this).val(val);
		}).keyup(function(event) {
			var key = event.keyCode;
			var val = Number($(this).val());
			if (key == 38)
				$(this).val((val + 0.2).toFixed(1));
			else if (key == 40)
				$(this).val((val - 0.2).toFixed(1));
		}).numbericOnly();

		// > UP 
		$("#mdi" + self.ViewName).find("#ul_values input[name='btn_up']").click(function() {
			var val = $(this).parent().parent().find("input[type=text]").val();
			var series_id = this.id.split('_')[1];
			val = Number(val);

			//  
			if (series_id == "sma" || series_id == "dis") {
				if (val >= 300)
					val = 300;
				else
					val = val + 1;
			} else if (series_id == "parabolic") {
				if (val >= 100)
					val = 100.00;
				else
					val = (val + 0.1).toFixed(1);
			} else {
				if (val >= 100)
					val = 100;
				else
					val = val + 1;
			}

			$(this).parent().parent().find("input[type=text]").val(val);
		});

		// > DOWN 
		$("#mdi" + self.ViewName).find("#ul_values input[name='btn_down']").click(function() {
			var val = $(this).parent().parent().find("input[type=text]").val();

			val = Number(val);

			if (series_id == "parabolic") {
				if (val <= 0.1)
					val = (0.1).toFixed(1);
				else
					val = (val - 0.1).toFixed(1);
			} else {
				if (val <= 1)
					val = 1;
				else
					val = val - 1;
			}

			$(this).parent().parent().find(
					"input[type=text]").val(val);
		});

		// >  UP 
		$("#mdi" + self.ViewName).find("#ul_colors input[name='btn_up']").click(function() {
			var val = $(this).parent().parent().find("input[type=text]").val();
			var series_id = this.id.split('_')[1];
			val = Number(val);

			if (val >= 5)
				val = "5.0";
			else
				val = (val + 0.2).toFixed(1);

			$(this).parent().parent().find(
					"input[type=text]").val(val);
		});

		// >  DOWN 
		$("#mdi" + self.ViewName).find("#ul_colors input[name='btn_down']").click(function() {
			var val = $(this).parent().parent().find("input[type=text]").val();

			val = Number(val);

			if (val <= 0.2)
				val = 0.2;
			else
				val = (val - 0.2).toFixed(1);

			$(this).parent().parent().find("input[type=text]").val(val);
		});

	};
